### JavaScript

```javascript
"use strict";

function convertToTitle(columnNumber) {
    let res = [];
    while (columnNumber) {
        columnNumber -= 1;
        res.push(String.fromCharCode('A'.charCodeAt(0) + columnNumber % 26));
        columnNumber = Math.floor(columnNumber / 26);
    }
    return res.reverse().join('');
}
